import React, { Component }  from 'react';
import Table from './components/table.js';

class App extends Component {
    constructor(props) {
      super(props);
      this.state = {
        company: [],
        isLoading: false,
        error: null,
      }
    }
  render() {
    return (
      <div className="tabla">
        <Table company={this.state.company}/>
      </div>
    );
  }
  componentDidMount() {
    fetch('https://prueba6.herokuapp.com/companies?eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjVjYTVmZTAxNWQxMGJlMDAwNDA1ZDU0MiIsImlhdCI6MTU1NDM4MjMzN30.vIlV2FVQ1ZJ0LibsMYdlsnrsUznWZrAAgBAd5A8jpKs')
    .then(res => res.json())
    .then(json => json.company)
    .then(company => this.setState({ 'company': company })).then(console.log(json))
  }
}

export default App;
